import React from "react";
// import "./style.css";

const mapStyles = {
    width: "50%",
    height: "50%"
  };

const Map= props => (
  <div
    className="card"
    google={this.props.google}
    zoom={14}
    style={mapStyles}
    initialCenter={{lat: props.lat, lng: props.long}}
  ></div>
);

export default Map;
